export class Catalog extends Component {
  state = {
    isOpen: false,
    typeOfProduct: '',
    typeOfView: '',
    typeOfGender: [],
    typeOfBrand: [],
    searchField: '',
    openDrawer: false,
    initialLoading: true,
    typeOfSearching: '',
    data: [],
    next: '',
  };

  componentDidMount() {
    this._getData();
  }

  _getData = (stringParams = '') => {
    if (stringParams) {
      fetchListWithOutsideUrl(`${API_URL}/${API.catalog.list}/${stringParams}`)
        .then(response => {
          this.setState({
            data: response.results,
            next: response.next,
            initialLoading: false,
          });
        })
        .catch(error => console.warn('error', error));
    } else {
      fetchList(API.catalog)
        .then(response => {
          this.setState({
            data: response.results,
            next: response.next,
            initialLoading: false,
          });
        })
        .catch(error => console.warn('error', error));
    }
  };

  backToCatalog = () => {
    this.setState(
      {
        typeOfProduct: '',
        typeOfView: '',
        typeOfGender: [],
        typeOfBrand: [],
        typeOfSearching: 'reset',
        searchField: '',
      },
      () => this._getData(),
    );
  };

  _LoadMoreCatalog = () => {
    const {next} = this.state;

    if (next) {
      loadMore(this, 'data', next);
    }
  };

  _generateParamsString = (
    typeOfProduct,
    typeOfView,
    typeOfGender,
    typeOfBrand,
  ) => {
    return `?${typeOfProduct ? `product_type=${typeOfProduct}` : ''}${
      typeOfView ? `&kind=${typeOfView}` : ''
    }${
      typeOfGender.length > 0 ? `&gender_choice=${typeOfGender.join(',')}` : ''
    }${typeOfBrand.length > 0 ? `&brand=${typeOfBrand.join(',')}` : ''}`;
  };

  _getFiltersParams = (
    typeOfProduct,
    typeOfView,
    typeOfGender,
    typeOfBrand,
    isReset = false,
  ) => {
    if (isReset) {
      this.setState(
        {
          typeOfProduct,
          typeOfView,
          typeOfGender,
          typeOfBrand,
          typeOfSearching: 'reset',
          searchField: '',
        },
        () => {
          this.__toggleDrawer(false);
          this._getData();
        },
      );
    } else {
      this.setState(
        {
          typeOfProduct,
          typeOfView,
          typeOfGender,
          typeOfBrand,
          typeOfSearching: 'filters',
          searchField: '',
        },
        () => {
          this.__toggleDrawer(false);
          this._getData(
            this._generateParamsString(
              typeOfProduct,
              typeOfView,
              typeOfGender,
              typeOfBrand,
            ),
          );
        },
      );
    }
  };

  onChangeSearchField = value => {
    this.setState({
      searchField: value,
      //  problems when openDrawer true, and we searching by word
      openDrawer: false,
    });
  };

  getDataBySearch = () => {
    const {searchField} = this.state;
    this._getData(`?search=${searchField}`);
    this.setState({
      typeOfSearching: 'string',
      typeOfProduct: '',
      typeOfView: '',
      typeOfGender: [],
      typeOfBrand: [],
      openDrawer: false,
    });

    Keyboard.dismiss();
  };

  __toggleDrawer = bool => {
    this.setState({
      openDrawer: bool,
      // openDrawer: true
    });
  };

  _keyExtractor = (item, index) => `catalogItem_${index}`;

  render() {
    const {data, searchField, typeOfSearching, initialLoading, openDrawer} =
      this.state;

    if (initialLoading) {
      return <Loader />;
    }

    const menu = (
      <DrawerCatalog
        _getFiltersParams={this._getFiltersParams}
        typeOfSearching={typeOfSearching}
      />
    );
    return (
      <SideMenu menu={menu} isOpen={openDrawer} menuPosition="right">
        <View style={styles.contentList}>
          <View style={styles.controllerContainer}>
            <View style={styles.controllerContainerItem}>
              <TextInput
                placeholder={t('Name, brand, code')}
                name="searchField"
                value={searchField}
                style={styles.searchInput}
                onChangeText={this.onChangeSearchField}
              />
              <TouchableOpacity
                style={[
                  styles.searchBtn,
                  {
                    marginRight: 10,
                    backgroundColor: '#000',
                  },
                ]}
                onPress={this.getDataBySearch}>
                <Icon name="search" size={20} color="#fff" />
              </TouchableOpacity>
              <TouchableOpacity
                style={[
                  styles.searchBtn,
                  {
                    borderBottomLeftRadius: 7,
                    borderTopLeftRadius: 7,
                  },
                ]}
                onPress={() => this.__toggleDrawer(true)}>
                <Icon name="filter" size={20} color="#fff" />
              </TouchableOpacity>
            </View>
          </View>
          <FlatList
            data={data}
            ListEmptyComponent={
              <View style={{alignItems: 'center'}}>
                <Text
                  style={{
                    textAlign: 'center',
                    fontSize: 16,
                    fontWeight: 'bold',
                  }}>
                  {t('No result found by the specified criteria')}
                </Text>
                <TouchableOpacity
                  style={styles.backToCatalog}
                  onPress={() => this.backToCatalog()}>
                  <Text style={styles.backToCatalogText}>
                    {t('To the catalog')}
                  </Text>
                </TouchableOpacity>
              </View>
            }
            keyExtractor={this._keyExtractor}
            renderItem={({item}) => (
              <CatalogItem {...item} navigation={this.props.navigation} />
            )}
            onEndReached={this._LoadMoreCatalog}
            // onEndReachedThreshold={0}
            onEndReachedThreshold={0.5}
            initialNumToRender={20}
          />
        </View>
      </SideMenu>
    );
  }
}

class CatalogItem extends Component {
  _navigateTo = () => {
    const {navigation, id, product_type} = this.props;

    navigation.navigate('CatalogItemDetail', {
      productId: id,
      product_type: product_type,
    });
  };
  render() {
    const {name, img, brand, perfume_code, gender_choice, is_new} = this.props;

    return (
      <TouchableOpacity style={styles.catalogItem} onPress={this._navigateTo}>
        {is_new ? (
          <View style={styles.catalogItemNew}>
            <Text style={styles.catalogItemTextNew}>NEW</Text>
          </View>
        ) : null}
        <Image source={{uri: img}} style={styles.catalogItemImg} />
        <View
          style={[
            styles.catalogItemColumn,
            {
              marginTop: 15,
              width: WIDTH - 190,
              marginRight: 13,
            },
          ]}>
          <Text
            style={[styles.catalogDefTextStyle, styles.catalogItemTitleText]}>
            {name}
          </Text>
          <Text
            style={[styles.catalogDefTextStyle, styles.catalogItemBrandText]}>
            {brand}
          </Text>
        </View>
        <View style={styles.catalogItemColumn}>
          <Text style={[styles.catalogItemCodeText, {}]}>
            {perfume_code ? `#${perfume_code}` : ''}
          </Text>
          <View
            style={{
              width: '100%',
              alignItems: 'center',
              position: 'absolute',
              right: 0,
              top: '45%',
            }}>
            <GenderIcon gender={gender_choice} />
          </View>
        </View>
      </TouchableOpacity>
    );
  }
}

const GenderIcon = props => {
  const {gender} = props;
  if (gender) {
    if (gender === 1) {
      return <Image source={{uri: ManLogo}} style={{width: 22, height: 22}} />;
    } else if (gender === 2) {
      return (
        <Image source={{uri: WomanLogo}} style={{width: 22, height: 22}} />
      );
    } else if (gender === 3) {
      return (
        <Image source={{uri: UnisexLogo}} style={{width: 30, height: 30}} />
      );
    }
  } else {
    return null;
  }
};

class DrawerCatalog extends Component {
  state = {
    typeOfSearching: '',

    typeOfProduct: '',
    typeOfView: '',
    typeOfGender: [],
    typeOfBrand: [],
    brands: [],
  };

  // PERFUMES = 1
  // ACCESSORIES = 2

  // MALE = 1
  // FEMALE = 2
  // UNISEX = 3

  // BRAND = 1
  // NICHE = 2

  componentDidMount() {
    this._getBrands();
  }

  _getBrands = () => {
    fetchList(API.catalog.brands)
      .then(response => {
        this.setState({
          brands: response.results,
          next: response.next,
        });
      })
      .catch(error => {
        console.warn('error', error);
      });
  };

  __changeSearching = () => {
    this.setState({
      typeOfSearching: 'filters',
    });
  };

  _LoadMore = () => {
    const {next} = this.state;
    if (next) {
      loadMore(this, 'brands', next);
    }
  };

  shouldComponentUpdate(nextProps, nextState) {
    if (
      nextProps.typeOfSearching !== nextState.typeOfSearching &&
      nextState.typeOfSearching !== ''
    ) {
      this.setState({
        typeOfSearching: nextProps.typeOfSearching,
        typeOfProduct: '',
        typeOfView: '',
        typeOfGender: [],
        typeOfBrand: [],
      });
    }

    return true;
  }

  toggleCurrentFilter_radiobutton = value => {
    this.setState({
      typeOfProduct: value,
      typeOfView: '',
      typeOfGender: [],
      typeOfBrand: [],
    });
  };

  toggleBrandOrNiche = value => {
    this.setState({
      typeOfView: value,
    });
  };

  toggleCurrentFilter_checkbox = (
    value,
    spaceForCurrentOption,
    nameOfCurrentSpace,
  ) => {
    if (spaceForCurrentOption.indexOf(value) >= 0) {
      this.setState({
        [nameOfCurrentSpace]: spaceForCurrentOption.filter(i => i !== value),
      });
    } else {
      spaceForCurrentOption.push(value);
      this.setState({
        [nameOfCurrentSpace]: spaceForCurrentOption,
      });
    }
  };

  _getFiltersParamsFromProps = () => {
    const {typeOfProduct, typeOfView, typeOfGender, typeOfBrand} = this.state;

    const {_getFiltersParams} = this.props;

    _getFiltersParams(typeOfProduct, typeOfView, typeOfGender, typeOfBrand);
  };

  _resetFilters = () => {
    const {_getFiltersParams} = this.props;

    this.setState(
      {
        typeOfProduct: '',
        typeOfView: '',
        typeOfGender: [],
        typeOfBrand: [],
      },
      () => _getFiltersParams('', '', [], [], true),
    );
  };

  render() {
    const {
      typeOfProduct,
      typeOfView,
      typeOfGender,
      typeOfBrand,
      brands,
      next,
      typeOfSearching,
    } = this.state;

    return (
      <View style={styles.drawerFilterContainer}>
        <View
          style={[
            styles.helpTextContainer,
            typeOfSearching === 'filters'
              ? {backgroundColor: 'green'}
              : {backgroundColor: 'red'},
          ]}>
          <Text style={styles.helpText}>
            {typeOfSearching === 'filters'
              ? t('Filters apply')
              : t('Filters not used')}
          </Text>
        </View>
        <ScrollView style={styles.drawerScrollViewContainer}>
          <View>
            <View style={styles.titleBlock}>
              <Text style={styles.titleBlockText}>{t('Product type')}</Text>
            </View>
            <RadiobuttonInput
              name={t('Perfumery')}
              defValue={1}
              currentTypeOfProduct={typeOfProduct}
              eventClick={this.toggleCurrentFilter_radiobutton}
            />
            <RadiobuttonInput
              name={t('Accessories')}
              defValue={2}
              currentTypeOfProduct={typeOfProduct}
              eventClick={this.toggleCurrentFilter_radiobutton}
            />
          </View>
          <ContentByProduct
            _LoadMore={this._LoadMore}
            brands_next={next}
            brands={brands}
            type={typeOfProduct}
            typeOfView={typeOfView}
            typeOfGender={typeOfGender}
            typeOfBrand={typeOfBrand}
            toggleCurrentFilter_checkbox={this.toggleCurrentFilter_checkbox}
            _getFiltersParamsFromProps={this._getFiltersParamsFromProps}
            toggleBrandOrNiche={this.toggleBrandOrNiche}
            __changeSearching={this.__changeSearching}
            _resetFilters={this._resetFilters}
          />
        </ScrollView>
      </View>
    );
  }
}

const ContentByProduct = props => {
  const {
    brands,
    type,
    typeOfGender,
    typeOfView,
    typeOfBrand,
    toggleCurrentFilter_checkbox,
    _getFiltersParamsFromProps,
    toggleBrandOrNiche,
    _LoadMore,
    brands_next,
    __changeSearching,
    _resetFilters,
  } = props;

  const list = brands.map((item, index) => (
    <CheckboxInput
      key={`brand_index_${index}`}
      name={item.name}
      defValue={item.id}
      spaceOfOptions={typeOfBrand}
      nameOfCurrentSpace="typeOfBrand"
      eventClick={toggleCurrentFilter_checkbox}
    />
  ));

  switch (type) {
    case 1:
      return (
        <View>
          <View>
            <View style={styles.titleBlock}>
              <Text style={styles.titleBlockText}>{t('View')}</Text>
            </View>
            <RadiobuttonInput
              name={t('Brand`s')}
              defValue={1}
              currentTypeOfProduct={typeOfView}
              eventClick={toggleBrandOrNiche}
            />
            <RadiobuttonInput
              name={t('Niche')}
              defValue={2}
              currentTypeOfProduct={typeOfView}
              eventClick={toggleBrandOrNiche}
            />
          </View>
          <View>
            <View style={styles.titleBlock}>
              <Text style={styles.titleBlockText}>{t('For who')}</Text>
            </View>
            <CheckboxInput
              name={t('Women`s')}
              defValue={2}
              spaceOfOptions={typeOfGender}
              nameOfCurrentSpace="typeOfGender"
              eventClick={toggleCurrentFilter_checkbox}
            />
            <CheckboxInput
              name={t('Men`s')}
              defValue={1}
              spaceOfOptions={typeOfGender}
              nameOfCurrentSpace="typeOfGender"
              eventClick={toggleCurrentFilter_checkbox}
            />
            <CheckboxInput
              name={t('Unisex')}
              defValue={3}
              spaceOfOptions={typeOfGender}
              nameOfCurrentSpace="typeOfGender"
              eventClick={toggleCurrentFilter_checkbox}
            />
          </View>
          <View>
            <View>
              <View style={styles.titleBlock}>
                <Text style={styles.titleBlockText}>{t('Brands')}</Text>
              </View>
              {list}
              <LoadMore_Btn pressEvent={_LoadMore} next_bool={!!brands_next} />
            </View>
          </View>
          <View style={styles.containerRow}>
            <TouchableOpacity
              onPress={() => {
                _getFiltersParamsFromProps();
                __changeSearching();
              }}
              style={styles.drawerBtn}>
              <Text style={styles.drawerBtnText}>{t('Apply')}</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={[styles.drawerBtn, {backgroundColor: '#e3837b'}]}
              onPress={_resetFilters}>
              <Text style={styles.drawerBtnText}>{t('Reset')}</Text>
            </TouchableOpacity>
          </View>
        </View>
      );
    case 2:
      return (
        <View>
          <View>
            <View style={styles.titleBlock}>
              <Text style={styles.titleBlockText}>{t('View')}</Text>
            </View>
            <RadiobuttonInput
              name={t('Brand`s')}
              defValue={1}
              currentTypeOfProduct={typeOfView}
              eventClick={toggleBrandOrNiche}
            />
            <RadiobuttonInput
              name={t('Niche')}
              defValue={2}
              currentTypeOfProduct={typeOfView}
              eventClick={toggleBrandOrNiche}
            />
          </View>
          <View>
            <View style={styles.titleBlock}>
              <Text style={styles.titleBlockText}>{t('Brands')}</Text>
            </View>
            {list}
            <LoadMore_Btn pressEvent={_LoadMore} next_bool={!!brands_next} />
          </View>
          <View style={styles.containerRow}>
            <TouchableOpacity
              onPress={() => {
                _getFiltersParamsFromProps();
                __changeSearching();
              }}
              style={styles.drawerBtn}>
              <Text style={styles.drawerBtnText}>{t('Apply')}</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={[styles.drawerBtn, {backgroundColor: '#e3837b'}]}
              onPress={_resetFilters}>
              <Text style={styles.drawerBtnText}>{t('Reset')}</Text>
            </TouchableOpacity>
          </View>
        </View>
      );
    default:
      return null;
  }
};

const CheckboxInput = props => {
  const {name, defValue, spaceOfOptions, nameOfCurrentSpace, eventClick} =
    props;

  return (
    <TouchableOpacity
      style={styles.checkboxView}
      onPress={() => eventClick(defValue, spaceOfOptions, nameOfCurrentSpace)}>
      {spaceOfOptions.indexOf(defValue) >= 0 ? (
        <Icon
          color={'#ff0000'}
          style={{width: 26}}
          name="check-square-o"
          size={26}
        />
      ) : (
        <Icon color={'#ff0000'} style={{width: 26}} name="square-o" size={26} />
      )}
      <Text style={styles.checkboxViewText}>{name}</Text>
    </TouchableOpacity>
  );
};

const RadiobuttonInput = props => {
  const {name, defValue, currentTypeOfProduct, eventClick} = props;

  return (
    <TouchableOpacity
      style={styles.checkboxView}
      onPress={() => eventClick(defValue)}>
      {currentTypeOfProduct === defValue ? (
        <Icon
          color={'#ff0000'}
          style={{width: 26}}
          name="dot-circle-o"
          size={26}
        />
      ) : (
        <Icon color={'#ff0000'} style={{width: 26}} name="circle-o" size={26} />
      )}
      <Text style={styles.checkboxViewText}>{name}</Text>
    </TouchableOpacity>
  );
};

